"summary style" is not a content fork, see relevant guidance;
WP:content forking is a mainspace guideline, does not *necessarily* apply to project space; while "summary style", the technique, can be used in any namespace.
As I said, I think summary style the right way ahead here, and I see no consensus to the contrary. I've seen no convincing argumentation to the contrary either.

